Language.admin.rebranding_long_description={message:"#lineStart With the Remove Branding Add-on, you can customize your visitor experience to suit your brand and create seamless transitions from site to app. #lineEnd#lineStart Look at what you can do with this powerful Add-on: #lineEnd#listStart#listItemStart #strongStart Remove/Customize branding on the widget #strongEnd \u2014 make your brand the one they see and remember. #listItemEnd#listItemStart #strongStart Remove/Customize branding in ticketing emails and chat transcripts #strongEnd\u2014 build trust when you show up consistently every time. #listItemEnd#listItemStart #strongStart Set up a custom support email address #strongEnd so every follow up and response now comes with your name on it \u2014 not ours! #listItemEnd#listItemStart #strongStart Remove the tawk.to branding from the Knowledge Base and add your own domain #strongEnd - make it look like part of your website without hiring a developer to build it for you. #listItemEnd#listItemStart #strongStart White label the Chat Page, chat link and popout chat widget #strongEnd with your own domain for a URL that matches your website and brand. #listItemEnd#listEnd#lineStart Billed on a Property level, it can be purchased for each Property you would like to rebrand and make your own. #lineEnd",vars:"lineStart lineEnd listStart listEnd listItemStart listItemEnd strongStart strongEnd".split(" ")};
