Language.introTour.welcome_title={message:"Hello #name, #lineBreakWelcome to tawk.to",vars:["name","lineBreak"]};Language.introTour.welcome_content={message:"Would you like us to show you around so you can familiarize yourself with the dashboard?"};Language.introTour.takeTour={message:"Take Tour"};Language.introTour.skipTour={message:"No thanks, I\u2019ll take it from here"};Language.introTour.step1Title={message:"Incoming Chats"};Language.introTour.step1Content={message:"When a new chat comes in, it will display here for you to answer."};
Language.introTour.step2Title={message:"Notifications"};Language.introTour.step2Content={message:"Important updates and notifications can be found here."};Language.introTour.step3Title={message:"Personal Settings"};Language.introTour.step3Content={message:"Change or manage your profile, set your status, enable and disable notifications, and more."};Language.introTour.step4Title={message:"Visitor Monitoring"};Language.introTour.step4Content={message:"Keep track of the current visitors on your website in real time with live information."};
Language.introTour.step5Title={message:"Messaging Inbox"};Language.introTour.step5Content={message:"Look back through all past messages and manage chats with the built-in ticketing system."};Language.introTour.step6Title={message:"Add-ons"};Language.introTour.step6Content={message:"We have a range of Add-ons you can quickly and easily add to your tawk.to account, including our live answering service from just $1/hr."};Language.introTour.step7Title={message:"Admin Settings"};
Language.introTour.step7Content={message:"From here you can manage your chat settings, customize the chat widget, create shortcuts and more."};Language.introTour.step8Title={message:"Notifications"};Language.introTour.step8Content={message:"Important updates and notifications can be found here."};Language.introTour.step9Title={message:"Notifications"};Language.introTour.step9Content={message:"Important updates and notifications can be found here."};Language.introTour.mobileAppStepTitle={message:"Do you have a smartphone?"};
Language.introTour.stay_connected_mobile={message:"Stay connected while mobile"};Language.introTour.mobileAppStepContent_inmobile={message:"Be sure to download our Android or iOS app so you can answer chats on the go."};Language.introTour.mobileAppStepContent={message:"If you have a smartphone, be sure to download our Android or iOS app so you can answer chats on the go."};Language.introTour.scanMe={message:"Scan Me"};Language.introTour.finalStepTitle={message:"That concludes the tour"};
Language.introTour.finalStepTitleContent={message:"If you have any problems or issues, we are here to help. Feel free to browse our Help Center or open a ticket with our support team if you'd like to learn more."};Language.monitoringTour={};Language.monitoringTour.step1Content={vars:["strongStart","strongEnd","lineStart","lineEnd"],message:'#strongStart When someone visits your site, their information will be displayed in the monitoring section of the dashboard in one of the following 4 categories. #strongEnd#lineStart Active: A visitor listed as "Active" is browsing your site and is yet to engage in a chat. #lineEnd#lineStart Unanswered: Once a visitor starts chatting their status will be updated to "Unanswered". A chat agent has not yet joined the chat to reply. #lineEnd#lineStart Served: Once a chat agent has joined the incoming chat the visitors status will change once again to "Served". #lineEnd#lineStart Idle: Once a visitor has been inactive for 10 minutes their status will be changed to "Idle". If they continue to be inactive for 20 minutes they will no longer appear as a visitor. #lineEnd'};
Language.monitoringTour.step2Content={message:"You can easily see all of the visitor information at a glance."};Language.monitoringTour.step3Content={message:"Simulating a visitor allows you to run a test chat when there are no current visitors on any of your properties. Launching a simulated chat will allow you to see the chat from both the perspective of the visitor and the chat agent."};Language.monitoringTour.step4Content={message:"If you find yourself dealing with a troublesome visitor you can easily ignore or permanently ban them."};
Language.monitoringTour.step5Content={message:"When you've got a lot of chats to sort through, try filtering them to narrow down what you can see."};Language.monitoringTour.step6Content={message:"If you need to step away from monitoring the chat for a moment you can quickly enable and disable sleep mode here."};Language.reportingTour={};Language.reportingTour.step1Content={message:"To see an in-depth snapshot of the activity on your property, select the desired property, then choose either chats or tickets."};
Language.reportingTour.step2Content={message:"You can narrow down the results even further by selecting the dates you'd like to look at and adding a filter."};Language.reportingTour.step3Content={message:"There are 6 different reports available via tabs for both Chats and Tickets."};Language.reportingTour.step4Content={message:"Each report allows you to measure either by day or by the hour and toggle the report displayed as either a list or a graph."};Language.reportingTour.step5Content={message:"You can also use the export function to send a report to your email for use outside of the tawk.to dashboard."};
Language.adminTour={};Language.adminTour.step1Content={message:"Check and update the settings for the currently selected property. You can change the name, tawk.to site ID, delete the property and more."};Language.adminTour.step2Content={message:"Customize the design and behavior and schedule of your chat widget to suit your brand and business."};Language.adminTour.step3Content={message:"Don't have a website? or just want a hosted page to showcase your organization and chat directly with visitors? Create and customize a page here."};
Language.adminTour.step4Content={message:"Add and manage knowledgebase entries to allow your agents to quickly search for crucial information during chats."};Language.adminTour.step5Content={message:"Invite or remove property members and view the status of each account assigned to the property."};Language.adminTour.step6Content={message:"Set up separate departments for different areas of your business and assign users to them. You can then use these different departments to group functions within the dashboard. For example, you may want to have two separate departments set up for tickets to be assigned based on the visitor's questions."};
Language.adminTour.step7Content={message:"Create announcements and reminders to alert your chat agents of important information each time a new chat comes in. Agent alerts will only be seen by the agent and not the visitor."};Language.adminTour.step8Content={message:"View and manage the list of visitors that have previously been banned during chats."};Language.adminTour.step9Content={message:"Shortcuts allow you to create custom, pre-written responses to make chatting with visitors quicker and easier. Create shortcuts manually or import a list of shortcuts from a CSV file."};
Language.adminTour.step10Content={message:"With triggers, you can proactively engage visitors automatically by sending pre-written responses when certain conditions are met. Set up triggers to attract more visitor into your chats."};Language.adminTour.step11Content={message:"Tabs can be used to gain easy access to information or extra functions during chats. Manage existing default tabs or create custom ones to add new functionality."};Language.adminTour.step12Content={message:"From the Add-ons section of the dashboard, you can choose optional extra features to add to the tawk.to chat software."};
Language.adminTour.step13Content={message:"Manage the email settings for chat transcripts, new ticket notifications, offline forms and missed chat notifications."};Language.adminTour.step14Content={message:"Create a webhook and send real-time notifications of events within tawk.to to external services. Choose to send a webhook event when a chat begins, ends, when a ticket is created or all three."};Language.adminTour.step15Content={message:"Manage billing details and subscriptions for Add-ons, view invoices and email receipt settings."};
